import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <React.Fragment>
      <header style={{ border: "1px solid purple", color: "purple" }}>
        <h1>NavBar Component</h1>
        <h3>Weather App</h3>
        <nav>
          <Link to="/">Home </Link>
          <Link to="/favourite-places">Favourite places </Link>
          <Link to="/help">Help </Link>
        </nav>
      </header>
    </React.Fragment>
  );
};

export default NavBar;
